import React, { useState, useEffect } from "react";
import { BrowserRouter, Route, Routes, useParams, useNavigate } from "react-router-dom";
import axios from "axios";
import ChannelSelect from "./ChannelSelect";
import ChannelPage from "./ChannelPage";
import { userEmail } from "./Mypage";

interface UserData {
  user_id: string;
  channels: Channel[];
}

interface Channel {
  channel_id: number;
  channel_name: string;
  messages: Message[];
}

interface Message {
  message_id: {
    String: string;
    Valid: boolean;
  };
  channel_id: number;
  user_id: string;
  content: {
    String: string;
    Valid: boolean;
  };
  edited_at: {
    String: string;
    Valid: boolean;
  };
}

const GetUserChannels3: React.FC = () => {
  const [userData, setUserData] = useState<UserData | null>(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");
  const { channelName } = useParams<{ channelName: string }>();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const response = await axios.get(
          `http://localhost:8081/user-channels?email=${userEmail}`
        );
        setUserData(response.data);
        setIsLoading(false);
      } catch (error) {
        setError("Failed to fetch user data");
        setIsLoading(false);
      }
    };

    fetchUserData();
  }, []);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h1>User Data:</h1>
      <BrowserRouter>
        <Routes>
          <Route
            path="/user-channels"
            element={<ChannelSelect userData={userData} />}
          />
          <Route
            path="/channel/:channelName"
            element={
              <ChannelPage
                channels={userData?.channels || []}
                channelName={channelName || ""}
              />
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default GetUserChannels3;
